import MenuItem from "./Menuitem";
const menuItems = ["Home", "Recent winners", "How to Play", "FAQ"];
function Menu() {
    return (
        <div className="menu">
            {menuItems.map((item) => {
                <MenuItem item={item} />
            })}

        </div>
    );
}

export default Menu;
